  false,\n\t\"url\": null,\n\t\"notes\": \"The focus of this deployment is the collection
  of multiple acoustic datasets and water column parameters to be used toward assisting
  fish stock assessments.nnThe National Centers for Environmental Information (NCEI)
  received the data in this archival package from the Integrated Ocean Observing System's
  National Glider Data Assembly Center (IOOS NGDAC). The IOOS NGDAC received the data
  in one or more netCDF files comprising an entire glider deployment. The data are
  measurements of physical oceanographic properties such as temperature, salinity,
  conductivity, and density. The IOOS NGDAC checked the files for compliance to their
  netCDF file convention, aggregated the files into a single netCDF file, and then
  submitted the file to NCEI for long-term preservation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
